" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lymphocytic infiltration in autoimmune ovarian failure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 436px; height: 301px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
