var title_f23_15_23804="PCP prophylaxis";
var content_f23_15_23804=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F79988&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F79988&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Pneumocystis pneumonia prophylaxis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Drug",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dosage",
"      </td>",
"      <td class=\"subtitle1\">",
"       Adverse reactions",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"       Preferred regimen for both primary and secondary prophylaxis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"1\" rowspan=\"5\">",
"       TMP-SMX",
"      </td>",
"      <td>",
"       1 DS tablet daily",
"      </td>",
"      <td colspan=\"1\" rowspan=\"5\">",
"       Fever, rash, neutropenia, gastrointestinal upset, transaminase elevation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        OR",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1 DS tablet three times per week",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        OR",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1 SS tablet daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\" rowspan=\"1\">",
"       Alternative regimens",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Atovaquone suspension",
"      </td>",
"      <td>",
"       1500 mg orally once daily",
"      </td>",
"      <td>",
"       Gastrointestinal distress, rash",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2_start\" colspan=\"1\" rowspan=\"3\">",
"       Dapsone",
"      </td>",
"      <td>",
"       50 mg twice daily",
"      </td>",
"      <td colspan=\"1\" rowspan=\"3\">",
"       Fever, rash, gastrointestinal upset, methemoglobinemia, hemolytic anemia (check for G6PD deficiency)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <strong>",
"        OR",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist_other_start\">",
"       100 mg daily",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"1\" rowspan=\"3\">",
"       In patients who are IgG seropositive for toxoplasmosis AND are HIV-positive with a CD4 count &lt;100 cells/&micro;L OR in HIV-negative patients with risk factors for toxoplasmosis",
"      </td>",
"      <td class=\"sublist_other\">",
"       Dapsone 50 mg daily plus Pyrimethamine 50 mg weekly plus Leucovorin 25 mg weekly",
"      </td>",
"      <td class=\"sublist_other\" rowspan=\"3\">",
"       <p>",
"        Pyrimethamine: folate deficiency, gastrointestinal upset, rash",
"       </p>",
"       <p>",
"        Leucovorin: rash, thrombocytosis, wheezing, anaphylactoid reactions",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist_other\">",
"       OR",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist_other\">",
"       Dapsone 200 mg weekly plus Pyrimethamine 75 mg weekly plus Leucovorin 25 mg weekly",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Aerosolized pentamidine",
"      </td>",
"      <td>",
"       300 mg monthly (via Respigard II nebulizer)",
"      </td>",
"      <td>",
"       Cough, wheezing, extrapulmonary pneumocystosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Intravenous pentamidine",
"      </td>",
"      <td>",
"       4 mg/kg IV monthly",
"      </td>",
"      <td>",
"       Nephrotoxicity, hypercalcemia, hypoglycemia, hypotension, pancreatitis, dysrhythmia, transaminase elevation",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
