var title_f23_15_23806="Long term follow up iliac stenting";
var content_f23_15_23806=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58444&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58444&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 473px\">",
"   <div class=\"ttl\">",
"    Long term follow up iliac stenting",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 453px; height: 253px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In this trial, 279 patients with intermittent claudication due to iliac artery stenosis were randomized to primary stenting or selective stenting for a residual gradient after angioplasty. The two groups had the same hemodynamic parameters at baseline, as determined by ankle-brachial index (ABI) measured after treadmill testing. At two years, the distribution of ABI was similar in the two groups.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Tetteroo, E, van der Graaf, Y, Bosch, JL, et al, for the Dutch Iliac Stent Trial Study Group, Lancet 1998; 351:1153.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
